import HomePage from './pages/Home.jsx';  // match your component name

function App() {
  return (
    <Router>
      <div className="app-container">
        <Routes>
          <Route path="/" element={<LandingPage />} />
          <Route path="/home" element={<HomePage />} />
          {/* add other routes here */}
        </Routes>
      </div>
    </Router>
  );
}
